int XmlDec_Ns10_Event_listener (OSCTXT* pctxt, Ns10_Event_listener* pvalue)
{
   int stat = 0;

   memset (&pvalue->m, 0, sizeof(pvalue->m));

   /* decode attributes */
   if (rtXmlpHasAttributes (pctxt)) {
      static const OSXMLAttrDescr attrNames[] = {
         { {OSUTF8("actuate"), 7}, 0 },
         { {OSUTF8("href"), 4}, 0 },
         { {OSUTF8("show"), 4}, 0 },
         { {OSUTF8("type"), 4}, 0 },
         { {OSUTF8("action"), 6}, 0 },
         { {OSUTF8("direction"), 9}, 0 },
         { {OSUTF8("effect"), 6}, 0 },
         { {OSUTF8("speed"), 5}, 0 },
         { {OSUTF8("start-scale"), 11}, 0 },
         { {OSUTF8("verb"), 4}, 0 },
         { {OSUTF8("event-name"), 10}, 0 }
      } ;
      OSUINT32 attrPresent[1];
      size_t i, nAttrs = 0;
      OSXMLNameFragments attrName;
      int tabidx;

      memset (attrPresent, 0, sizeof(attrPresent));

      stat = rtXmlpGetAttributeCount (pctxt);
      if (stat < 0) return LOG_RTERR (pctxt, stat);
      else nAttrs = (size_t)stat;

      for (i = 0; i < nAttrs; i++) {
         if (rtXmlpSelectAttribute (pctxt, &attrName, i) != 0) continue;
         tabidx = rtXmlpGetAttributeID (pctxt, 
            &attrName.mLocalName, 11, attrNames, attrPresent);

         switch (tabidx) {
         case 0: /* actuate */
            stat = XmlDec_Ns10_Event_listener_actuate (pctxt, &pvalue->actuate
               );
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            pvalue->m.actuatePresent = TRUE;
            break;

         case 1: /* href */
            stat = XmlDec_Xlink_Href (pctxt, &pvalue->href);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            pvalue->m.hrefPresent = TRUE;
            break;

         case 2: /* show */
            stat = XmlDec_Ns10_Event_listener_show (pctxt, &pvalue->show);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            pvalue->m.showPresent = TRUE;
            break;

         case 3: /* type */
            stat = XmlDec_Xlink_Type (pctxt, &pvalue->type);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            pvalue->m.typePresent = TRUE;
            break;

         case 4: /* action */
            stat = XmlDec_Ns10_Event_listener_action (pctxt, &pvalue->action);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            break;

         case 5: /* direction */
            stat = XmlDec_Ns10_Event_listener_direction (pctxt, &pvalue->
               direction);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            pvalue->m.directionPresent = TRUE;
            break;

         case 6: /* effect */
            stat = XmlDec_Ns10_Event_listener_effect (pctxt, &pvalue->effect);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            pvalue->m.effectPresent = TRUE;
            break;

         case 7: /* speed */
            stat = XmlDec_Ns10_Event_listener_speed (pctxt, &pvalue->speed);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            pvalue->m.speedPresent = TRUE;
            break;

         case 8: /* start-scale */
            stat = rtXmlpDecDynUTF8Str (pctxt, &pvalue->start_scale);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            pvalue->m.start_scalePresent = TRUE;
            break;

         case 9: /* verb */
            stat = rtXmlpDecUInt (pctxt, &pvalue->verb);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            pvalue->m.verbPresent = TRUE;
            break;

         case 10: /* event-name */
            stat = XmlDec_Event_name (pctxt, &pvalue->event_name);
            if (stat != 0) return LOG_RTERR (pctxt, stat);

            break;

         default:
            stat = rtXmlpDecXSIAttr (pctxt, &attrName);
            if (stat != 0) {
               rtxErrAddStrParm (pctxt, "Ns10_Event_listener");
               rtxErrAddStrnParm (pctxt, (const char*)attrName.mQName.value, 
                  attrName.mQName.length);
               LOG_RTERRNEW (pctxt, RTERR_INVATTR);
               stat = 0;
            }
         }
         if (stat < 0) {
            rtxErrAddStrParm (pctxt, "Ns10_Event_listener");
            rtxErrAddStrnParm (pctxt, (const char*)attrName.mQName.value, 
               attrName.mQName.length);
            LOG_RTERRNEW (pctxt, RTERR_DECATTRFAIL);
            stat = 0;
         }
      }
   }

   { int elemID;

   static const OSXMLElemIDRec elemtab[] = {
      {{{OSUTF8("sound"), 5}, 0}, 0 }
   } ;
   static const struct {
      int row;
      int num;
      int anyCase;
   } groupDesc[] = { {0, 1, -1}};

   int group = 0;
   int i;
   for (i = 0; i < 1; i++) {
      int fromrow = groupDesc[group].row;
      int rows = groupDesc[group].num;
      int anyCase = groupDesc[group].anyCase;

      elemID = rtXmlpGetNextElemID (pctxt, 
         elemtab + fromrow, rows, -1, FALSE);
      if (elemID == RTERR_UNEXPELEM && anyCase >= 0 && i == anyCase)
         elemID = anyCase;
      else if (elemID < 0) return LOG_RTERR (pctxt, elemID);
      else if (elemID == XML_OK_EOB) break;
      else if (elemID == elemtab[fromrow + rows - 1].id) group++;

      switch (elemID) {
      case 0: { /* sound */
         stat = XmlDec_Ns10_Sound (pctxt, &pvalue->sound);
         if (stat != 0) return LOG_RTERR (pctxt, stat);

         stat = rtXmlpMatchEndTag (pctxt, -1);
         if (stat < 0) return LOG_RTERR (pctxt, stat);

         pvalue->m.soundPresent = TRUE;
         break;
      }
      }
      i = elemID;
   }
   }

   return (stat);
}

